(86, 'OGTT', '<h3 style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Clinical Biochemistry Examination Report<br><br></strong></span></h3>\r\n<table style=\"border-collapse: collapse; width: 99.8233%; height: 258.312px; border-width: 1px; border-spacing: 1px;\" border=\"1\"><colgroup><col style=\"width: 30.3712%;\"><col style=\"width: 33.8899%;\"><col style=\"width: 35.7418%;\"></colgroup>\r\n<tbody>\r\n<tr style=\"height: 46.0469px; text-align: left;\">\r\n<td style=\"height: 46.0469px; border-width: 1px; padding: 1px; text-align: left;\"><strong>Test Name</strong></td>\r\n<td style=\"height: 46.0469px; border-width: 1px; padding: 1px; text-align: left;\"><strong>Result&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></td>\r\n<td style=\"height: 46.0469px; border-width: 1px; padding-top: 1px; padding-right: 1px; padding-bottom: 1px; text-align: left;\"><strong>Refference Value&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></td>\r\n</tr>\r\n<tr style=\"height: 46.0469px;\">\r\n<td style=\"height: 46.0469px; border-width: 1px; padding-top: 1px; padding-right: 1px; padding-bottom: 1px;\">Fasting Blood Sugar (FBS)&nbsp;&nbsp;</td>\r\n<td style=\"height: 46.0469px; border-width: 1px; padding: 1px;\">&nbsp;</td>\r\n<td style=\"height: 46.0469px; border-width: 1px; padding: 1px;\">3.9-6.1 mmol/L</td>\r\n</tr>\r\n<tr style=\"height: 31.875px;\">\r\n<td style=\"height: 31.875px; border-width: 1px; padding-top: 1px; padding-right: 1px; padding-bottom: 1px;\">Corr. Urine Sugar</td>\r\n<td style=\"height: 31.875px; border-width: 1px; padding-top: 1px; padding-right: 1px; padding-bottom: 1px;\">&nbsp;</td>\r\n<td style=\"height: 31.875px; border-width: 1px; padding-top: 1px; padding-right: 1px; padding-bottom: 1px;\">NIl</td>\r\n</tr>\r\n<tr style=\"height: 44.7812px;\">\r\n<td style=\"border-width: 1px; padding-top: 1px; padding-right: 1px; paddi