idth: 1px;\">Platelet Count</td>\r\n<td style=\"height: 47.375px; border-width: 1px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">45000 /cumm</span></td>\r\n<td style=\"height: 47.375px; border-width: 1px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">150000-400000 /cumm</span></td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"height: 22.3906px; border-width: 1px;\" colspan=\"3\"><span style=\"text-decoration: underline;\"><strong>Total Count:</strong></span></td>\r\n</tr>\r\n<tr style=\"height: 23.3906px;\">\r\n<td style=\"border-width: 1px; height: 23.3906px;\">White Blood Cell</td>\r\n<td style=\"border-width: 1px; height: 23.3906px;\">9000/cumm</td>\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">4000 - 11000 /cumm</span></td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"border-width: 1px; height: 22.3906px;\" colspan=\"3\"><span style=\"text-decoration: underline;\"><strong>DIFFERENTIAL LEUCOCYTE COUNT</strong></span></td>\r\n</tr>\r\n<tr style=\"height: 16.3906px;\">\r\n<td style=\"border-width: 1px; height: 16.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Neutrophils&nbsp; &nbsp;</span></td>\r\n<td style=\"border-width: 1px; height: 16.3906px;\"><span style=\"font-size: 8pt;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">60 %&nbsp; &nbsp; &nbsp; </span></span></td>\r\n<td style=\"border-width: 1px; height: 16.3906px;\">40-75 %</td>\r\n</tr>\r\n<tr style=\"height: 23.3906px;\">\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Lymphocytes</span></td>\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">30 %</span></td>\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">20 - 45 %</span></td>\r\n</tr>\r\n<tr style=\"height: 23.3906px;\">\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Monocytes</span></td>\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">04 %</span></td>\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">02 - 10 %</span></td>\r\n</tr>\r\n<tr style=\"height: 23.3906px;\">\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Eosinophils</span></td>\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">06 %</span></td>\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">01 - 06 %</span></td>\r\n</tr>\r\n<tr style=\"height: 23.3906px;\">\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Basophils</span></td>\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">00 %</span></td>\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">&lt; 1 - 2 %</span></td>\r\n</tr>\r\n<tr style=\"height: 23.3906px;\">\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Red Blood Cells</span></td>\r\n<td style=\"border-width: 1px; height: 23.3906px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">3.92million/cumm</span></td>\r\n<td style=\"b