(1, 'Grameen Bank Medical Center', 'uploads/GBMC5.jpg', 'Grameen Bank, Mirpur 2', '880258055652', '+88 02 58055652', '+880 1713-205689', 'gbmc@gbhbd.org', '৳', 'Grameen Bank presents', '', ' The Grameen Bank project started in 1976 as an action research pilot project in \"Jobra\" village in Chattogram district of Bangladesh. In 1983, the pilot project was transformed into a bank with the aim of alleviating poverty and empowering the marginalized poor in Bangladesh through micro-credit', 'https://www.facebook.com/gbbankmc', 'https://twitter.com/gbmedicalcenter', 'gbank.mc@gmail.com', 'https://www.youtube.com', 'grameenbank.org', NULL, 'gbmedicalcenter', 'uploads/customer.svg', '\"Best and effective medical services with best doctor and staffs. Highly recommend their treatment and diagnosis.\"', '\"Best and effective medical services with best doctor and staffs. Highly recommend their treatment and diagnosis.\"', 'Grameen Bankers', 'Grameen Bankers', 'uploads/grameen_medical_footer_logo-015.jpg', 'uploads/grameen_medical_footer_logo-017.jpg', 'The unknown is just a question, we find the answers.', 'Getting an accurate diagnosis can be one of the most impactful experiences that you can have — especially if you', 'Why choose us', 'Seamless care from our hospitals', 'Unparalleled expertise from our doctors ', 'Successful treatment starts with an accurate diagnosis, and our experts take the time to get it right. A team of specialists will listen to your needs and evaluate your condition from every angle to make the very best plan for you.', 'At our hospital, every aspect of your care is coordinated and teams of experts work together to provide exactly the care you need. What might take months elsewhere can often be done in days here.', 'Every year, more than a million people come to our hospital for care. Our highly specialized experts are more experienced in treating rare and complex conditions.', 'The Bank of poor, The Medical of poor. We believe in better treatment .', 'The Bank of poor, The Medical of poor. We believe in better treatment .', 'The Bank of poor, The Medical of poor. We believe in better treatment .', 'The Bank of poor, The Medical of poor. We believe in better treatment .', 'The Bank of poor, The Medical of poor. We believe in better treatment .', 'The Bank of poor, The Medical of poor. We believe in better treatment .', 'The Bank of poor, The Medical of poor. We believe in better treatment .', 'The Bank of poor, The Medical of poor. We believe in better treatment .', 'The Bank of poor, The Medical of poor. We believe in better treatment .', 'uploads/1554821799398.jpg', 'uploads/ycTkMykY2FeBui9drjczGn-1200-80.jpg', 'uploads/RD-solicita-facilidad-para-adquisicion.jpg', 'Appointment availability and visitor restrictions', 'Successful treatment starts with an accurate diagnosis, and our experts take the time to get it right. A team of specialists will listen to your needs and evaluate your condition from every angle to make the very best plan for you.', 'Every year, more than a million people come to Clinic for care. Our highly specialized experts are more experienced in treating rare and complex conditions.', 'uploads/RD-solicita-facilidad-para-adquisicion1.jpg', NULL, NULL, NULL, 'uploads/photo-1503023345310-bd7c1de61c7d1.jpg', 'uploads/astana.jpg', 'uploads/innnn.jpg', 'uploads/unbounce.jpg', 'Medical for poor, Health for poor', 'The Grameen Bank project started in 1976 as an action research pilot project in \"Jobra\" village in Chattogram district of Bangladesh. In 1983, the pilot project was transformed into a bank with the aim of alleviating poverty and empowering the marginalized poor in Bangladesh through micro-credit.', 'Its a link', '@skd_alapan', 'Hospital Patient', '“I have never (ever!) experienced such a smooth and effective care and service\"', 'Bankers', 'uploads/15548217993981.jpg', 'uploads/GBMC4.jpg', 'Testing Purpose', 'Contact With Us', NULL, 'Do not insert the direct chat link here. Follow the below instruction.', 'yes', NULL);
